import React from 'react';

export default class P2 extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
         name:"p2"
         ,myApp:this.props.myParent
         ,myParent:this.props.myParent
         ,hidden:this.props.hidden
        }

        this.state.myParent.setState((x) => {
            x.myChildrens.push(this);
          });
    }
    componentWillMount() {
    }

